import React from 'react';
import ReactDom from 'react-dom';

const TodoList = () => {
    return(
        <ul>
            <li>Learn React</li>
            <li>Build App</li>
        </ul>
    )
}

const AppHeader = () => {
    return(<h1>My TodoList</h1>)
}

const Search = () => {
    return(<input type="search"/>)
}

const App = () => {
   return( <div>
        <AppHeader />
        <Search />
        <TodoList />
    </div> )
}


ReactDom.render(<App/>, document.getElementById('root'));
